  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0112885 includes chemical,
  physical and time series data collected from MOORINGS in the North Pacific Ocean
  from 2009-09-19 to 2010-10-28. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
  (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN - PERCENT SATURATION, Partial pressure (or
  fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon
  dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect
  these data include Bubble type equilibrator for autonomous carbon dioxide (CO2)
  measurement and Carbon dioxide (CO2) gas analyzer.nnThese data were collected by
  Adrienne Sutton, Christopher Sabine, Stacy Maenner and Sylvia Musielewicz of US
  DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the Mooring_TAO110W
  data set. CDIAC associated the following cruise ID(s) with this data set: T11020090919nnThe
  Global CO2 Time-series and Moorings Project involves international groups from 18
  countries who have mounted sensors on moored buoys to provide high resolution time-series
  measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
  (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
  Ocean Carbon Coordination Project (IOCCP).\",\n\t\"license_title\": null,\n\t\"extras\":
